Verenigde Staten
Drama / Muziek
98 minuten

geregisseerd door Jon Chu
met Briana Evigan, Robert Hoffman en Telisha Shaw

De straatdanseres Andie komt op een nette school voor kunst terecht. Op school moet Andie zich anders leren te gedragen, maar probeert niet te vergeten waar ze vandaan komt. Als ze samen gaat dansen met de populaire Chase om de ondergrondse danswedstrijd, genaamd The Streets, te winnen, krijgt ze de kans om de twee werelden waarin ze leeft te overbruggen en haar grote droom waar te maken.

Met Nl subs.



